import React, { Component } from "react";
import "./App.css";

import { connect } from "react-redux";

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <h1>{this.props.ctr}</h1>
        <select>
          <option>kssjd</option>
          <option>kssjd</option>
          <option>kssjd</option>
        </select>
      </div>
    );
  }
}

const mapStateToProps = state => {
  return {
    ctr: state.counter
  };
};

export default connect(mapStateToProps)(App);
